#include "Hooks.h"
#include "shonaxsettings.h"
void __fastcall Hooks::Hooked_SceneEnd( void *ecx, void *edx ) {
	g_fnOriginalSceneEnd(ecx, edx);

	auto m_local = game::localdata.localplayer();

	if ( m_local && m_local->IsAlive( ) ) {
		for ( int i = 1; i <= m_pGlobals->maxClients; i++ ) {
			auto m_entity = m_pEntityList->GetClientEntity( i );

			if ( m_entity && m_entity != m_local && m_entity->GetClientClass( )->m_ClassID == ( int )CSGOClassID::CCSPlayer && m_entity->IsAlive( ) && !m_entity->IsDormant( ) ) {
				int teamnum = m_entity->GetTeamNum( );
				
				bool flat = Shonax::settingsxd.chamstype == 2;
				bool wireframe = Shonax::settingsxd.chamstype == 3;
				bool glass = Shonax::settingsxd.chamstype == 4;
				

				if (Shonax::settingsxd.chamsenemyinvisible && teamnum != m_local->GetTeamNum( ) ) {
					Color color = Color(Shonax::settingsxd.chamsenemyinvisiblecolor[0]*255, Shonax::settingsxd.chamsenemyinvisiblecolor[1] * 255, Shonax::settingsxd.chamsenemyinvisiblecolor[2] * 255, Shonax::settingsxd.chamsenemyinvisiblecolor[3] * 255);
					chams->override_material( true, flat, wireframe, glass, color );
					m_entity->DrawModel( 0x1, m_entity->GetModelInstance( ) );
					m_pModelRender->ForcedMaterialOverride( nullptr );
				}
				else if (Shonax::settingsxd.chamsteaminvisible && teamnum == m_local->GetTeamNum( ) ) {
					Color color = Color(Shonax::settingsxd.chamsteaminvisiblecolor[0]*255, Shonax::settingsxd.chamsteaminvisiblecolor[1] * 255, Shonax::settingsxd.chamsteaminvisiblecolor[2] * 255, Shonax::settingsxd.chamsteaminvisiblecolor[3] * 255);
					chams->override_material( true, flat, wireframe, glass, color );
					m_entity->DrawModel( 0x1, m_entity->GetModelInstance( ) );
					m_pModelRender->ForcedMaterialOverride( nullptr );
				}
				
				if (Shonax::settingsxd.chamsenemy && teamnum != m_local->GetTeamNum( ) ) {
					Color color = Color(Shonax::settingsxd.chamsenemycolor[0]*255, Shonax::settingsxd.chamsenemycolor[1] * 255, Shonax::settingsxd.chamsenemycolor[2] * 255, Shonax::settingsxd.chamsenemycolor[3] * 255);
					chams->override_material( false, flat, wireframe, glass, color );
					m_entity->DrawModel( 0x1, m_entity->GetModelInstance( ) );
					m_pModelRender->ForcedMaterialOverride( nullptr );
				}
				
				else if (Shonax::settingsxd.chamsteam && teamnum == m_local->GetTeamNum( ) ) {
					Color color = Color(Shonax::settingsxd.chamsteamcolor[0]*255, Shonax::settingsxd.chamsteamcolor[1] * 255, Shonax::settingsxd.chamsteamcolor[2] * 255, Shonax::settingsxd.chamsteamcolor[3] * 255 );
					chams->override_material( false, flat, wireframe, glass, color );
					m_entity->DrawModel( 0x1, m_entity->GetModelInstance( ) );
					m_pModelRender->ForcedMaterialOverride( nullptr );

				}
			}
		}
		
		bool flat = Shonax::settingsxd.fakechamstype == 1;
		bool wireframe = Shonax::settingsxd.fakechamstype == 2;
		bool glass = Shonax::settingsxd.fakechamstype == 3;
		
		if (Shonax::settingsxd.espfakechams) {
			auto original_angle = *m_local->GetEyeAngles();
			m_local->SetAngle2(Vector(0, game::globals.fake_angle.y, 0));
			m_local->UpdateClientSideAnimation();
			Color color = Color(Shonax::settingsxd.espfakechamscolor[0]*255, Shonax::settingsxd.espfakechamscolor[1] * 255, Shonax::settingsxd.espfakechamscolor[2] * 255, Shonax::settingsxd.espfakechamscolor[3] * 255);
			chams->override_material(false, flat, wireframe, glass, color);
			m_local->DrawModel(0x1, m_local->GetModelInstance());
			m_pModelRender->ForcedMaterialOverride(nullptr);
			m_local->SetAngle2(original_angle);
			m_local->UpdateClientSideAnimation();
		}
	}
}

